import BoxRHS from "./Main/BoxRHS";

import "./Main.css";
import PatientReg from "./Main/Login_Reg/PatientReg";
import { Routes, Route } from "react-router-dom";

const Main = () => {
  return (
    <div>
      <BoxRHS />
      <Routes>       
        <Route path="PatientRegistration" element={<PatientReg/>} />
      </Routes>
    </div>
  );
};

export default Main;
